let base64_img = ('data:image/jpeg;base64,');

function consoleLogImg (imgURL, imgSIZE) {

    if (imgSIZE === undefined) {imgSIZE = 100;}
    var image = new Image();
    image.onload = function () {
        var img_style = [
            'font-size: 0px;',
            'padding: ' + (this.height / 100 * (imgSIZE/2)) + 'px ' + (this.width / 100 * (imgSIZE/2)) + 'px;',
            'background: url(' + imgURL + ') no-repeat;',
            'background-size: 100% 100%',
        ].join(' ');
        console.log('%c ', img_style);
    };
    image.src = imgURL;
}
consoleLogImg(base64_img, 20); // 보여주고 싶은 이미지의 비율